import '../blocks/column/column.css';
import Button from './Button';
import iconDel from '../images/icons8-delete.svg';

export default function Column({id, name, handleClick}) {
  return (
    <div id={id} className='column'>
      {name}
      <Button
        content={iconDel}
        handleClick={handleClick}
        type='image'
        id={id}
      />
    </div>
  )
}
